import React from 'react'
import { inject, observer } from 'mobx-react'
import Link from 'next/link';

@inject('store')
@observer
class Page extends React.Component {
    render() {
        console.log(this.props);

        return (
            <div>
                <h1>{this.props.store.message}</h1>
                <h2>ASDASD</h2>
                <Link href='/other'>
                    <a>Other</a>
                </Link>
                <br />
                <hr />
                <button onClick={() => this.props.store.changeMessage('ASDasdasd')} type='button'>Click me!</button>
            </div>
        )
    }
}

export default Page
